pub enum AnyBody<B = BoxBody> {
    None,
    Bytes {
        body: Bytes,
    },
    Body {
        body: B,
    },
}

pub enum Connection<A, B = Box<dyn ConnectionIo>> where A: ConnectionIo,
         B: ConnectionIo {
    Tcp(ConnectionType<A>),
    Tls(ConnectionType<B>),
}

pub enum ConnectionType<Io: ConnectionIo> {
    H1(H1Connection<Io>),
    H2(H2Connection<Io>),
}

pub enum ConnectorServiceFuture<S1, S2, Io1, Io2> where S1: Service<Connect,
         Response = (Io1, Protocol), Error = (Io1, Protocol)>, S1: Clone,
         S1: 'static, S2: Service<Connect, Response = (Io2, Protocol), Error =
         (Io2, Protocol)>, S2: Clone, S2: 'static, Io1: ConnectionIo,
         Io2: ConnectionIo {
    Tcp {
        fut: <ConnectionPool<S1, Io1> as Service<Connect>>::Future,
    },
    Tls {
        fut: <ConnectionPool<S2, Io2> as Service<Connect>>::Future,
    },
    SslIsNotSupported,
}

pub enum InvalidUrl {
    MissingScheme,
    UnknownScheme,
    MissingHost,
    HttpError(http::Error),
}

pub enum FreezeRequestError {
    Url(InvalidUrl),
    Http(HttpError),
    Custom(BoxError, Box<dyn fmt::Debug>),
}

pub enum ConnectRequest {
    Client(RequestHeadType, AnyBody, Option<net::SocketAddr>),
    Tunnel(RequestHead, Option<net::SocketAddr>),
}

pub enum ConnectResponse {
    Client(ClientResponse),
    Tunnel(ResponseHead, Framed<BoxedSocket, ClientCodec>),
}

pub enum ConnectRequestFuture<Fut, Io> where Io: ConnectionIo {
    Connection {
        fut: Fut,
        req: Option<ConnectRequest>,
    },
    Client {
        fut: LocalBoxFuture,
    },
    Tunnel {
        fut: LocalBoxFuture,
    },
}

pub enum JsonPayloadError {
    ContentType,
    Deserialize(JsonError),
    Payload(PayloadError),
}

pub enum RedirectServiceFuture<S> where S: Service<ConnectRequest, Response =
         ConnectResponse, Error = ConnectResponse>, S: 'static {
    Tunnel {
        fut: S::Future,
    },
    Client {
        fut: S::Future,
        max_redirect_times: u8,
        uri: Option<Uri>,
        method: Option<Method>,
        headers: Option<header::HeaderMap>,
        body: Option<Bytes>,
        addr: Option<SocketAddr>,
        connector: Option<Rc<S>>,
    },
}

pub enum SendClientRequest {
    Fut(Pin<Box<dyn Future<Output =
                Result<ConnectResponse, SendRequestError>>>>,
        Option<Pin<Box<Sleep>>>, bool),
    Err(Option<SendRequestError>),
}
